import React from 'react';
import './App.css';
import Header from "./components/Heder/Header";
import Navbar from "./components/Navbar/Navbar";
import MyPosts from "./components/Profile/MyPosts/MyPosts";

const App = () => {
  return (
    <div className="app-wrapper">
        <Header />
        <Navbar />
        <MyPosts />
    </div>
  );
};

export default App;
